import L from "leaflet";
import { EpciType } from "../../api/Global";

export const drawEpciOnMap = (map: L.Map, epci:string, ecpis:EpciType[]) : void => {
    const d = ecpis.find(r => r.siren === epci);
    if (!d || !d.poly) {
        return
    };
    d.poly.forEach( c => {
      const polyline = L.polyline(c) ;
      polyline.setStyle({
        color: '#b36b00',
        weight: 1,
      })
      polyline.addTo(map) ;
    })
  }    

